import RecipeDetail from '../components/recipiedetail.js';
function RecipieDetails() {
  const {id } = useParams()
  return (
    
    <div className="App  overflow-hidden ">
      <Nav />
      {console.log(id)}
      <RecipeDetail/>
      <Footer/>
    </div>

  );
}

export default RecipieDetails;
